from typing import List

def separate_paren_groups(paren_string: str) -> List[str]:
    stack = []
    groups = ['']

    for char in paren_string:
        if char not in '() ':
            continue

        if char == '(':
            stack.append('(')
        elif char == ')':
            stack.pop()

        groups[-1] += char

        if not stack:
            groups.append('')

    return groups[0:-1]

