    def poly(x: float):
        """
        Evaluates polynomial with coefficients xs at point x.
        return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
        """
        return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])

    def f(x):
        return poly(x)

    def derivative(f, x):
        h = 1e-5
        return (f(x + h) - f(x)) / h

    def newton_raphson_method(f, derivative, start, i=0):
        while abs(f(start)) >= 0.001:
            start = start - f(start) / derivative(f, start)
            i += 1
        return start

    return newton_raphson_method(f, derivative, 10) # could be any starting point, most likely 0.

